import logo from './logo.svg';

function App() {
  return (
    <div className="App" style={{ display: "flex", justifyContent: "center" }}>



    </div>
  );
}

function allergens() {

  const allergensRank1 = ['Decyl Glucoside', 'Alkyl (c8,c10) Polyglycoside', 'APG0810', '(C8-10) Alkyl ether of corn sugar' , 'C16H32O6' , 'D-Glucopyranoside, decyl', 'D-Glucopyranose, Oligomeric, Decyl Octyl Glycosides', 'D-glucose, decyl octyl ethers, oligomeric', 'Decyl D-glucopyranoside','Decyl D-glucoside','Decyl octyl d-glucose', 'Glucoside, decyl'];

  const allergensRank2 = ['Hexyl cinnamic aldehyde (Article Number H-025', 'Coumarin (Article Number C-038)', 'Farnesol (Article Number F-004)', 'Hydroxyisohexyl 3 Cyclohexene Carboxaldehyde (Article Number L-003)']

  return ( 
    <div>

    <div style={{ width: 400 }}>
      {allergensRank1.map(ele => 
      <div>
          <h7>{ele}</h7>
        </div>
      )} 
      </div>

    <div style={{ width: 400 }}>
      {allergensRank2.map(ele => 
      <div>
          <h7>{ele}</h7>
        </div>
      )}
      </div>

    </div>
  )

}

